import React from 'react';
import './App.scss';
import {useFetchWeather} from "./hooks/useFetchWeather";

const App: React.FC = () => {
    useFetchWeather()
    return (
        <div className="App">
            <h1>Works</h1>
        </div>
    );
}

export default App;
